import Box from "@mui/material/Box";
import Modal from "@mui/material/Modal";
import Code01 from "../../images/code01.svg";

import { ContainerModal } from "./style";

export default function WeeklyModal({ open, handleClose, weeklyFeed }) {
  return (
    <Modal
      open={open}
      onClose={handleClose}
      aria-labelledby="modal-modal-title"
      aria-describedby="modal-modal-description"
    >
      <Box>
        <ContainerModal>
          <section className="contentModal">
            <div className="contentModalBox">
              <section>
                <div>index.tsx</div>
                <img className="imgLogo" src={Code01} alt="24" />
              </section>
              <section>
                <div>style.tsx</div>
                <pre>
                  <code>
                    {`body {
                        color: yellow;
                        font-size: 16px;
                        line-height: 1.5;
                     }`}
                  </code>
                </pre>
              </section>
            </div>
            <button onClick={handleClose} className="btnClose">
              Fechar
            </button>
          </section>
        </ContainerModal>
      </Box>
    </Modal>
  );
}
